Here is the JSON array of actions to compute amounts for space, shipping, storage or demurrage charges:
<OUTPUT_JSON>
[
  {
    "action": "type",
    "selector": "input[name*=space i], input[placeholder*=space i]",
    "text": "<space_amount>"
  },
  {
    "action": "type", 
    "selector": "input[name*=charge i]",
    "text": "<charge_amount>"
  },
  {
    "action": "click",
    "selector": "button:has-text(\"calculate\" i), button:has-text(\"compute\" i)",
    "text": ""
  },
  {
    "action": "click",
    "selector": "button:has-text(\"save\" i)",
    "text": ""
  }
]
</OUTPUT_JSON>
